import "./App.css";
import React, { Component } from "react";

class App extends Component {
  render() {
    const name = "Simon";
    const loading = true;

    return (
      <div className="App">
        {loading ? <h1>Loading</h1> : <h1>Hello {name}</h1>}
      </div>
    );
  }
}

export default App;
